import React from "react";
import AuthBox from "../../shared/components/AuthBox";
import LoginPageHeader from "./LoginPageHeader";
import LoginPageInputs from "./LoginPageInputs";

const LoginPage = () => {
    return <AuthBox>
        <LoginPageHeader/>
        <LoginPageInputs />
    </AuthBox>;
};

export default LoginPage;
